import React, { Component } from 'react';
import Slider from 'react-slick';
import 'slick-carousel/slick/slick.css';
import 'slick-carousel/slick/slick-theme.css';
import './components/slider.scss';
import { PortHead } from './components/header';
// import { Link } from 'react-router-dom';
import { Main, Img, ProH, Spacer } from './components/components';

export const SlImg = (props) => (
	<div className="aspect-ratio aspect-ratio--7x5">
		<div
			className="aspect-ratio--object cover "
			style={{
				background: `url(${props.src}) no-repeat top center`,
			}}
		/>
	</div>
);

class Peya extends Component {
	render() {
		var settings = {
			dots: false,
			fade: true,
			infinite: true,
			speed: 500,
			autoplay: true,
			slidesToShow: 1,
			slidesToScroll: 1,
			className: 'slides',
			arrows: false,
		};
		return (
			<section className="w-70 w-60-ns w-100-m center bg-white pa3 br4">
				<Slider {...settings} className="bg-agray br3 ma2 ma1-m">
					<SlImg src="./img/yape/proposal.png" />
					<SlImg src="./img/yape/proposal1.png" />
					<SlImg src="./img/yape/proposal2.png" />
					<SlImg src="./img/yape/proposal3.png" />
					<SlImg src="./img/yape/proposal4.png" />
					<SlImg src="./img/yape/proposal5.png" />
					<SlImg src="./img/yape/proposal6.png" />
					<SlImg src="./img/yape/proposal7.png" />
					<SlImg src="./img/yape/proposal8.png" />
					<SlImg src="./img/yape/proposal9.png" />
				</Slider>
			</section>
		);
	}
}

export const Yape = () => (
	<main>
		<PortHead />
		<Main>
			<ProH title="Yape" subtitle="immagine coordinata - 2018">
				<video
					muted
					autoPlay
					src="../img/yape/yape.mp4"
					className="whale flex w-100 w-70-ns center br4"
					id="vid"
				/>
			</ProH>
			<Spacer h="h5" />
			<div className="w-70 w-60-ns w-100-m br4 center bg-white pa3">
				<div className="optima ttu f1 fw5 tracked-tight">Keywords</div>
				<Spacer h="h3" />
				<div className="optima ttu f-6 f-5-m fw5 tracked-tight pop">POP</div>
				<div className="optima ttu f-6 f-5-m fw5 tracked-tight friendly">
					Friendly
				</div>
				<div className="optima ttu f-6 f-5-m fw5 tracked-tight original">
					Original
				</div>
				<div className="optima ttu f-6 f-5-m fw5 tracked-tight functional">
					Functional
				</div>
			</div>
			<Spacer h="h5" />
			<div className="flex justify-center w-60-ns w-100 w-70 center">
				<div className="bg-white br4 pa3 flex flex-column-m justify-between">
					<div className="optima f3 fw4 ttu">Schemi preparatori</div>
					<div className="flex flex-column w-60">
						<div className="pa3 bg-agray br4 mb3">
							<Img src="../img/yape/yapetype.jpg" class="pa3 bg-white br3" />
						</div>
					</div>
				</div>
			</div>
			<Spacer h="h3" />
			<Peya />
		</Main>
	</main>
);
